metadata = {
    'apiLevel': '2.3',
    'protocolName': 'Custom CSV Transfer Protocol',
    'author': 'Rachel Voyt',
    'description': '''This protocol is a modified version of the 'Custom CSV Transfer' protocol from OT2. The protocol includes steps to dilute overamplifying primers and create three primer pools (two split pools and one full pool) with two aliquots each at ~0.25 uM per primer. The protocol also allows for the use of two pipette types (p20_single and p300_single, both with filter tips), pauses to switch out primer plates, and adds a mixing step and air gap to each transfer.'''
}

def run(protocol):

    [pipette_type_s20,
     pipette_mount_s20,
     tip_type_s20,
     tip_reuse_s20,
     pipette_type_s300,
     pipette_mount_s300,
     tip_type_s300,
     tip_reuse_s300,
     transfer_csv] = get_values(  # noqa: F821
        "pipette_type_s20",
        "pipette_mount_s20",
        "tip_type_s20",
        "tip_reuse_s20",
        "pipette_type_s300",
        "pipette_mount_s300",
        "tip_type_s300",
        "tip_reuse_s300",
        "transfer_csv")

    # strip headers
    transfer_info = [[val.strip().lower() for val in line.split(',')]
                     for line in transfer_csv.splitlines()
                     if line.split(',')[0].strip()][1:]
    
    # load labware
    for line in transfer_info:
        s_lw, s_slot, d_lw, d_slot = line[2:4] + line[6:8]
        for slot, lw in zip([s_slot, d_slot], [s_lw, d_lw]):
            if not int(slot) in protocol.loaded_labwares:
                protocol.load_labware(lw.lower(), slot)

    # load tipracks
    tipracks_s20 = [protocol.load_labware(tip_type_s20, slot)
            for slot in ['1', '4', '7']]
    tipracks_s300 = [protocol.load_labware(tip_type_s300, slot)
            for slot in ['6']]

    # load pipettes
    s20 = protocol.load_instrument(pipette_type_s20, pipette_mount_s20, tip_racks=tipracks_s20)
    s300 = protocol.load_instrument(pipette_type_s300, pipette_mount_s300, tip_racks=tipracks_s300)
            
    tip_count_s20 = 0
    tip_count_s300 = 0

    tip_max_s20 = len(tipracks_s20*96)
    tip_max_s300 = len(tipracks_s300*96)

    def pick_up_s20():
            nonlocal tip_count_s20
            if tip_count_s20 == tip_max_s20:
                protocol.pause('Please refill 20 ul tipracks before resuming.')
                s20.reset_tipracks()
                tip_count_s20 = 0
            s20.pick_up_tip()
            tip_count_s20 += 1

    def pick_up_s300():
        nonlocal tip_count_s300
        if tip_count_s300 == tip_max_s300:
            protocol.pause('Please refill 200 ul tipracks before resuming.')
            s300.reset_tipracks()
            tip_count_s300 = 0
        s300.pick_up_tip()
        tip_count_s300 += 1

    def parse_well(well):
        letter = well[0]
        number = well[1:]
        return letter.upper() + str(int(number))

    if tip_reuse_s20 == 'never':
        pick_up_s20()
    if tip_reuse_s300 == 'never':
        pick_up_s300()

    # transfers for primer plates 1, 2, and 3
    for line in transfer_info:
        if 'plates123' in line[0]:
            _, _, _, s_slot, s_well, h, _, d_slot, d_well, vol = line[:10]
            source = protocol.loaded_labwares[
                int(s_slot)].wells_by_name()[parse_well(s_well)].bottom(float(h))
            dest = protocol.loaded_labwares[
                int(d_slot)].wells_by_name()[parse_well(d_well)]
            if float(vol) <= 20:
                if tip_reuse_s20 == 'always':
                    pick_up_s20()
                s20.transfer(float(vol),
                            source,
                            dest,
                            air_gap=1,
                            new_tip='never')
                if tip_reuse_s20 == 'always':
                    s20.drop_tip()
            else:
                if tip_reuse_s300 == 'always':
                    pick_up_s300()
                s300.transfer(float(vol),
                            source,
                            dest,
                            air_gap=1,
                            new_tip='never')
                if tip_reuse_s300 == 'always':
                    s300.drop_tip()
    if s20.hw_pipette['has_tip']:
        s20.drop_tip()
    if s300.hw_pipette['has_tip']:
        s300.drop_tip()

    # switch primer plates
    protocol.pause("Remove primer plates 1, 2, and 3 from the OT2 deck. Seal and place on ice. Then briefly vortex and spin down primer plates 4, 5, and 6. Remove seals and place on OT2 deck (plate 4 in slot 2, plate 5 in slot 5, and plate 6 in slot 8).")

    # transfers for primer plates 4, 5, and 6
    for line in transfer_info:
        if 'plates456' in line[0]:
            _, _, _, s_slot, s_well, h, _, d_slot, d_well, vol = line[:10]
            source = protocol.loaded_labwares[
                int(s_slot)].wells_by_name()[parse_well(s_well)].bottom(float(h))
            dest = protocol.loaded_labwares[
                int(d_slot)].wells_by_name()[parse_well(d_well)]
            if float(vol) <= 20:
                if tip_reuse_s20 == 'always':
                    pick_up_s20()
                s20.transfer(float(vol),
                            source,
                            dest,
                            mix_before=(10, 20),
                            air_gap=1,
                            new_tip='never')
                if tip_reuse_s20 == 'always':
                    s20.drop_tip()
            else:
                if tip_reuse_s300 == 'always':
                    pick_up_s300()
                s300.transfer(float(vol),
                            source,
                            dest,
                            mix_before=(10, 200),
                            air_gap=1,
                            new_tip='never')
                if tip_reuse_s300 == 'always':
                    s300.drop_tip()
    if s20.hw_pipette['has_tip']:
        s20.drop_tip()
    if s300.hw_pipette['has_tip']:
        s300.drop_tip()